 title=\"\u0412\u0430\u0441\u043a\u043e \u0434\u0430 \u0413\u0430\u043c\u0430\">\u0412\u0430\u0441\u043a\u043e \u0434\u0430 \u0413\u0430\u043c\u0430<\/a> \u043f\u0440\u0438\u043f\u043b\u044b\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B7%D0%B0%D0%BC%D0%B1%D0%B8%D0%BA\" title=\"\u041c\u043e\u0437\u0430\u043c\u0431\u0438\u043a\">\u041c\u043e\u0437\u0430\u043c\u0431\u0438\u043a<\/a>.<\/li><\/ul><h3>XVI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1555_%D0%B3%D0%BE%D0%B4\" title=\"1555 \u0433\u043e\u0434\">1555 \u0433\u043e\u0434<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%81%D1%82%D1%80%D0%B0%D0%B4%D0%B0%D0%BC%D1%83%D1%81\" title=\"\u041d\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043c\u0443\u0441\">\u041d\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043c\u0443\u0441<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u0441\u0432\u043e\u044e \u043a\u043d\u0438\u0433\u0443 \u043f\u0440\u0435\u0434\u0441\u043a\u0430\u0437\u0430\u043d\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1562_%D0%B3%D0%BE%D0%B4\" title=\"1562 \u0433\u043e\u0434\">1562 \u0433\u043e\u0434<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BB%D0%B8%D0%B3%D0%B8%D0%BE%D0%B7%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B_%D0%B2%D0%BE_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8\" title=\"\u0420\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438\">\u0440\u0435\u043b\u0438\u0433\u0438\u043e\u0437\u043d\u044b\u0445 \u0432\u043e\u0438\u043d \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0_%D0%B4%D0%B5_%D0%93%D0%B8%D0%B7\" title=\"\u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u0434\u0435 \u0413\u0438\u0437\">\u0424\u0440\u04