0435\u0442 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0431\u044b\u043b\u043e 4 000 \u0436\u0438\u0442\u0435\u043b\u0435\u0439.<\/li><\/ul><h3>XVII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1638_%D0%B3%D0%BE%D0%B4\" title=\"1638 \u0433\u043e\u0434\">1638 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u0443\u044e \u0410\u043c\u0435\u0440\u0438\u043a\u0443<\/a> \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0446\u044b \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1692_%D0%B3%D0%BE%D0%B4\" title=\"1692 \u0433\u043e\u0434\">1692 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B9%D0%BB%D0%B5%D0%BC_(%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81)\" title=\"\u0421\u0435\u0439\u043b\u0435\u043c (\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441)\">\u0421\u0430\u043b\u0435\u043c\u0435<\/a> (\u0448\u0442. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81\" title=\"\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441\">\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441<\/a>) \u0432\u043b\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BB%D0%B5%D0%BC%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%B5%D0%B4%D1%8C%D0%BC%D1%8B\" class=\"mw-redirect\" title=\"\u0421\u0430\u043b\u0435\u043c\u0441\u043a\u0438\u0435 \u0432\u0435\u0434\u044c\u043c\u044b\">\u043e\u0431\u0432\u0438\u043d\u0438\u043b\u0438<\/a> \u0421\u0430\u0440\u0443 \u0413\u0443\u0434, \u0421\u0430\u0440\u0443 \u041e\u0441\u0431\u043e\u0440\u043d \u0438 \u0440\u0430\u0431\u044b\u043d\u044e \u0422\u0438\u0442\u0443\u0431\u0443 \u0432 \u043a\u043e\u043b\u0434\u043e\u0432\u0441\u0442\u0432\u0435. \u0412 \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u043c\u0435\u0441\u044f\u0446\u044b \u0431\u043e\u043b\u0435\u0435 150 \u0436\u0435\u043d\u0449\u0438\u043d \u0438 \u043c\u0443\u0436\u0447\u0438\u043d \u0431\u044b\u043b\u0438 \u0431\u0440\u043e\u0448\u0435\u043d\u044b \u0432 \u0442\u044e\u0440\u044c\u043c\u0443 \u043f\u043e \u0430\u043d\u0430\u043b\u043e\u0433\u0438\u0447\u043d\u044b\u043c \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044f\u043c, 19 \u0438\u0437 \u043d\u0438\u0445 \u043a\u0430\u0437\u043d\u0435\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1700_%D0%B3%D0%BE%D0%B4\" title=\"1700 \u0433\u043e\u0434\">1700 \u0433\u043e\u0434<\/a>&#160;\u2014 \u041f\u0451\u0442\u0440 I \u0443\u0447\u0440\u0435\u0434\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D0%B2%D0%B8%D0%B0%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%B8%D0%BA%D0%B0%D0%B7\" title=\"\u041f\u0440\u043e\u0432\u0438\u0430\u043d\u0442\u0441\u043a\u0438\u0439 \u043f\u0440\u0438\u043a\u0430\u0437\">\u041f\u0440\u043e\u0432\u0438\u0430\u043d\u0442\u0441\u043a\u0438\u0439 \u043f\u0440\u0438\u043a\u0430\u0437<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0438\u0439 \u043d\u0430\u0447\u0430\u043b\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044e \u0441\u043b\u0443\u0436\u0431\u044b \u0442\u044b\u043b\u0430 \u0432 \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e\u0439 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1711_%D0%B3%D0%BE%D0%B4\" title=\"1711 \u0433\u043e\u0434\">1711 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u00ab\u0421\u043f\u0435\u043a\u0442\u0435\u0439\u0442\u043e\u0440\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1762_%D0%B3%D0%BE%D0%B4\" title=\"1762 \u0433\u043e\u0434\">1762 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_III\" title=\"\u041f\u0451\u0442\u0440 III\">\u041f\u0451\u0442\u0440 III<\/a> \u0438\u0437\u0434\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B8%D1%84%D0%B5%D1%81%D1%82_%D0%BE_%D0%B2%D0%BE%D0%BB%D1%8C%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%B4%D0%B2%D0%BE%D1%80%D1%8F%D0%BD%D1%81%D1%82%D0%B2%D0%B0\" title=\"\u041c\u0430\u043d\u0438\u0444\u0435\u0441\u0442 \u043e \u0432\u043e\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0434\u0432\u043e\u0440\u044f\u043d\u0441\u0442\u0432\u0430\">\u00ab\u0443\u043a\u0430\u0437 \u043e \u0432\u043e\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0434\u0432\u043e\u0440\u044f\u043d\u0441\u043a\u043e\u0439\u00bb<\/a>, \u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0432\u0448\u0438\u0439 \u0434\u0432\u043e\u0440\u044f\u043d \u043e\u0442 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0433\u043e\u0441\u0441\u043b\u0443\u0436\u0431\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1767_%D0%B3%D0%BE%D0%B4\" title=\"1767 \u0433\u043e\u0434\">1767 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0438\u0437\u0433\u043d\u0430\u043d\u0438\u0435 \u043e\u0440\u0434\u0435\u043d\u0430 \u0438\u0435\u0437\u0443\u0438\u0442\u043e\u0432 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> \u043a\u043e\u0440\u043e\u043b\u0451\u043c \u041a\u0430\u0440\u043b\u043e\u043c III.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1780_%D0%B3%D0%BE%D0%B4\" title=\"1780 \u0433\u043e\u0434\">1780 \u0433\u043e\u0434<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D1%8C%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u041f\u0435\u043d\u0441\u0438\u043b\u044c\u0432\u0430\u043d\u0438\u044f\">\u041f\u0435\u043d\u0441\u0438\u043b\u044c\u0432\u0430\u043d\u0438\u044f<\/a> \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u044b\u043c \u0448\u0442\u0430\u0442\u043e\u043c, \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u0432\u0448\u0438\u043c \u0440\u0430\u0431\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1781_%D0%B3%D0%BE%D0%B4\" title=\"1781 \u0433\u043e\u0434\">1781 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u0432 \u0441\u0438\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%82%D1%8C%D0%B8_%D0%9A%D0%BE%D0%BD%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" title=\"\u0421\u0442\u0430\u0442\u044c\u0438 \u041a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\">\u0421\u0442\u0430\u0442\u044c\u0438 \u041a\u043e\u043d\u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1790_%D0%B3%D0%BE%D0%B4\" title=\"1790 \u0433\u043e\u0434\">1790 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B5%D0%BF%D0%B8%D1%81%D1%8C_%D0%BD%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D0%A1%D0%A8%D0%90_(1790)\" title=\"\u041f\u0435\u0440\u0435\u043f\u0438\u0441\u044c \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0421\u0428\u0410 (1790)\">\u043f\u0435\u0440\u0435\u043f\u0438\u0441\u044c \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0421\u0428\u0410<\/a>. \u041f\u043e \u0435\u0451 \u0438\u0442\u043e\u0433\u0430\u043c \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u043b\u0438 3 929 214 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u0432\u043a\u043b\u044e\u0447\u0430\u044f \u0438 \u043d\u0435\u0433\u0440\u043e\u0432-\u0440\u0430\u0431\u043e\u0432, \u0442\u0430\u043a \u043a\u0430\u043a 3\/5 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0445 \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u043b\u0438\u0441\u044c \u043f\u0440\u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0438 \u0447\u0438\u0441\u043b\u0430 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u043c\u0435\u043d\u043e\u0432 \u043e\u0442 \u043a\u0430\u0436\u0434\u043e\u0433\u043e \u0448\u0442\u0430\u0442\u0430. \u0418\u043d\u0434\u0435\u0439\u0446\u044b \u0432 \u043f\u0435\u0440\u0435\u043f\u0438\u0441\u0438 \u043d\u0435 \u0443\u0447\u0438\u0442\u044b\u0432\u0430\u043b\u0438\u0441\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u043e \u0442\u0430\u043d\u0446\u0435\u0432\u0430\u0442\u044c \u0432\u0430\u043b\u044c\u0441.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1803_%D0%B3%D0%BE%D0%B4\" title=\"1803 \u0433\u043e\u0434\">1803 \u0433\u043e\u0434<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B3%D0%B0%D0%B9%D0%BE\" title=\"\u041e\u0433\u0430\u0439\u043e\">\u041e\u0433\u0430\u0439\u043e<\/a> \u0441\u0442\u0430\u043b 17-\u043c \u0448\u0442\u0430\u0442\u043e\u043c \u0421\u0428\u0410.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810_%D0%B3%D0%BE%D0%B4\" title=\"1810 \u0433\u043e\u0434\">1810 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I \u0441\u0432\u043e\u0438\u043c \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442\u043e\u043c \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D1%85%D0%B0%D0%B7%D0%B8%D1%8F\" title=\"\u0410\u0431\u0445\u0430\u0437\u0438\u044f\">\u0410\u0431\u0445\u0430\u0437\u0438\u0438<\/a> \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1845_%D0%B3%D0%BE%D0%B4\" title=\"1845 \u0433\u043e\u0434\">1845 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410 \u0414\u0436\u043e\u043d \u0422\u0430\u0439\u043b\u0435\u0440 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u0437\u0430\u043a\u043e\u043d \u043e \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%85%D0%B0%D1%81\" title=\"\u0422\u0435\u0445\u0430\u0441\">\u0422\u0435\u0445\u0430\u0441\u0430<\/a> \u043f\u043e\u0434 \u044e\u0440\u0438\u0441\u0434\u0438\u043a\u0446\u0438