wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B8%D0%BE%D0%B4%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%8D%D0%BB%D0%B5%D0%BC%D0%B5%D0%BD%D1%82%D0%BE%D0%B2\" title=\"\u041f\u0435\u0440\u0438\u043e\u0434\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432\">\u0442\u0430\u0431\u043b\u0438\u0446\u0443 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432<\/a>, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043d\u0443\u044e \u043d\u0430 \u0438\u0445 \u0430\u0442\u043e\u043c\u043d\u043e\u043c \u0432\u0435\u0441\u0435 \u0438 \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u0441\u0445\u043e\u0434\u0441\u0442\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1872_%D0%B3%D0%BE%D0%B4\" title=\"1872 \u0433\u043e\u0434\">1872 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430 \u0421\u0428\u0410 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%99%D0%B5%D0%BB%D0%BB%D0%BE%D1%83%D1%81%D1%82%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u0419\u0435\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u043d\">\u0419\u0435\u043b\u043b\u043e\u0443\u0441\u0442\u043e\u0443\u043d\u0435<\/a> \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u0430\u0440\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1880_%D0%B3%D0%BE%D0%B4\" title=\"1880 \u0433\u043e\u0434\">1880 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0437\u0430\u043a\u043e\u043d\u0447\u0435\u043d\u043e \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%82%D0%B0%D1%80%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D1%82%D0%BE%D0%BD%D0%BD%D0%B5%D0%BB%D1%8C_(1882)\" title=\"\u0413\u043e\u0442\u0430\u0440\u0434\u0441\u043a\u0438\u0439 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0439 \u0442\u043e\u043d\u043d\u0435\u043b\u044c (1882)\">\u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u043e\u0433\u043e \u0442\u0443\u043d\u043d\u0435\u043b\u044f \u0421\u0435\u043d-\u0413\u043e\u0442\u0430\u0440\u0434<\/a> \u0432 \u0410\u043b\u044c\u043f\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u043a\u043e\u0440\u043f\u0443\u0441 \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u043b\u0435\u043d \u044d\u0444\u0438\u043e\u043f\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%90%D0%B4%D1%83%D0%B0\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0410\u0434\u0443\u0430\">\u0431\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u0410\u0434\u0443\u0430<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 \u0421\u0435\u043d\u0442-\u041b\u0443\u0438\u0441\u0435 \u0410\u043b\u044c\u0431\u0435\u0440\u0442 \u0411\u0435\u0440\u0440\u0438 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u0440\u044b\u0436\u043e\u043a \u0441 \u043f\u0430\u0440\u0430\u0448\u044e\u0442\u043e\u043c \u0438\u0437 \u043b\u0435\u0442\u044f\u0449\u0435\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 (\u0432\u044b\u0441\u043e\u0442\u0430 460 \u043c).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0440\u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u043c\u0438\u043b\u0438\u0446\u0438\u0438 \u0441\u043e\u0437\u0434\u0430\u043d \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0441\u0443\u0434\u0435\u0431\u043d\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0440\u0442\u0438\u0437\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%80%D1%8F%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0411\u0443\u0440\u044f\u0442\u0441\u043a\u0430\u044f \u0410\u0421\u0421\u0420\">\u0411\u0443\u0440\u044f\u0442\u0441\u043a\u0430\u044f \u0410\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043f\u0440\u0438\u043d\u044f\u0442 \u0437\u0430\u043a\u043e\u043d \u042d\u0448\u0430-\u041a\u0430\u043c\u043c\u0438\u0441\u0430, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0436\u0435\u043b\u0435\u0437\u043d\u044b\u0435 \u0434\u043e\u0440\u043e\u0433\u0438 \u0431\u044b\u043b\u0438 \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u044b \u043f\u0440\u0435\u0436\u043d\u0438\u043c \u0432\u043b\u0430\u0434\u0435\u043b\u044c\u0446\u0430\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0431\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u0438\u0445 \u043c\u043e\u0440\u044f\u043a\u043e\u0432 \u0432 \u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0435<\/a> \u043f\u043e\u0434 \u043b\u043e\u0437\u0443\u043d\u0433\u043e\u043c \u00ab\u0417\u0430 \u0421\u043e\u0432\u0435\u0442\u044b \u0431\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA\" class=\"mw-redirect\" title=\"\u0411\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\">\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u043d \u0411\u0430\u043d\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043b\u043e \u043f\u0440\u0430\u0432\u0430 \u041d\u044c\u044e\u0444\u0430\u0443\u043d\u0434\u043b\u0435\u043d\u0434\u0430 \u043d\u0430 \u0447\u0430\u0441\u0442\u044c \u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B1%D1%80%D0%B0%D0%B4%D0%BE%D1%80_(%D0%BF%D0%BE%D0%BB%D1%83%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)\" title=\"\u041b\u0430\u0431\u0440\u0430\u0434\u043e\u0440 (\u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432)\">\u041b\u0430\u0431\u0440\u0430\u0434\u043e\u0440<\/a>, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u0443\u044e \u0442\u0430\u043a\u0436\u0435 \u043f\u0440\u0435\u0442\u0435\u043d\u0434\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B2%D0%B5%D0%B1%D0%B5%D0%BA\" title=\"\u041a\u0432\u0435\u0431\u0435\u043a\">\u041a\u0432\u0435\u0431\u0435\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 \u0421\u0428\u0410 \u0434\u043e\u043a\u0442\u043e\u0440 \u0413\u0435\u0440\u0431\u0435\u0440\u0442 \u042d\u0432\u0430\u043d\u0441 \u043e\u0442\u043a\u0440\u044b\u043b \u0448\u0435\u0441\u0442\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%82%D0%B0%D0%BC%D0%B8%D0%BD%D1%8B\" title=\"\u0412\u0438\u0442\u0430\u043c\u0438\u043d\u044b\">\u0432\u0438\u0442\u0430\u043c\u0438\u043d<\/a>, \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u044b\u0439 \u0432\u0438\u0442\u0430\u043c\u0438\u043d\u043e\u043c F.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82_(%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82)\" class=\"mw-redirect\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0430\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 (\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442)\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0430\u0432\u0438\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%8C%D1%87%D0%B6%D0%BE%D1%83-%D0%B3%D0%BE\" title=\"\u041c\u0430\u043d\u044c\u0447\u0436\u043e\u0443-\u0433\u043e\">\u041c\u0430\u043d\u044c\u0447\u0436\u043e\u0443-\u0433\u043e<\/a>, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC